import React from 'react'
import { Route, Navigate } from "react-router-dom"

const GuestRoute = ({ element: Element, isAuthenticated, redirectTo, ...rest }) => {
    return (
      <Route
        {...rest}
        element={
          isAuthenticated ? <Navigate to={redirectTo} /> : <Element />
        }
      />
    );
  };

export default GuestRoute
